import AddExpensesButton from './AddExpenseButton';
import ExpenseForm from './ExpenseForm';

function NewExpenseDisplay(props) {
    if (props.renderForm) {
        return (
            <ExpenseForm
                onSaveNewExpenseData={onSaveNewExpenseDataHandler}
            />
        )
    }
    else {
        return (
            <AddExpensesButton/>
        )
    }
}

export default NewExpenseDisplay;
